    "tri-annual-narrative-reports-benton-lake-national-wildlife-refuge-may-to-august-1962",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Benton Lake National
    Wildlife Refuge outlines Refuge accomplishments from May to August of 1962. The
    report begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, and mammals- is also
    covered. The Refuge development and maintenance section discusses physical developments,
    collections and receipts, and prescribed burning. Resource management is outlined;
    topics include grazing and haying. The public relations section of the report describes
    recreational uses, Refuge participation, and safety. Photographs and NR Forms are
    attached.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
